import {FETCH_COLLECTION} from './types'



export const getQuestions = () => dispatch => {
    fetch('http://localhost:3000/collections/6')
    .then(res => res.json())
    .then((collection) => {
        var title = collection[0].name
        var prompts = [];

        collection.map((prompt) => {
            console.log(prompt)
            prompts.push(prompt)
        })

        dispatch({
            type: FETCH_COLLECTION,
            title,
            prompts
        })
    } 
    )
}
